import React, { Component } from 'react'
import styled from 'styled-components'

const Container= styled.div`
  border: solid 1px black;
  background: silver;
  display: flex;
  width: 95%;
`
class Contact extends Component {
  render() {
    return(
      <Container>

      </Container>
    )
  }
}

export default Contact
